Ext.data.JsonP['ACS_2013_10_October_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 2013 10 October Release Note</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50725344\" class=\"content\">\n                        <h1>ACS 2013 10 October Release Note</h1>\n    <p>This update includes the following enhancements:    </p>\n<ul class=\" \"><li class=\" \">    <p>New PushNotifications API to query existing push channels and the number of devices subscribed to a push channel. See <a class=\"external-link external-link\" href=\"/arrowdb/latest/#!/api/PushNotifications-method-channels_query\">push_notification/channels/query.json</a> and <a class=\"external-link \" href=\"https://wiki.appcelerator.org/display/~lbadenhop/Appcelerator+Platform+Services+SDK+for+Android+--+Appcelerator+ArrowDB+and+Arrow+Push\">push_notification/channels/show.json</a>.    </p>\n</li></ul>        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725344\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 10 October Release Note"});